import React from 'react';
import UserList from '../src/components/UserList';
import Pagination from '../src/components/Pagination';
import "./css/pagination.scss";
import "./css/App.scss";


function App() {
  return (
    <div className="App">
    <Pagination data={UserList}>
    <UserList/>
    </Pagination>
    </div>
  );
}

export default App;
